        <link rel=\"icon\" type=\"image/x-icon\" href=\"{{ asset('favicon.ico') }}\" />
        <link href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css\" rel=\"stylesheet\" integrity=\"sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T\" crossorigin=\"anonymous\">

    </head>
    <body>
        <div class=\"container\">
            <div class=\"row\">
                {% block menu %}
                    <div class=\"col-md-12\">
                        <nav class=\"navbar navbar-expand-lg navbar-dark bg-primary\">
                            <a class=\"navbar-brand\" href=\"#\">Menu</a>
                            <button class=\"navbar-toggler\" type=\"button\" data-toggle=\"collapse\" data-target=\"#navbarSupportedContent\" aria-controls=\"navbarSupportedContent\" aria-expanded=\"false\" aria-label=\"Toggle navigation\">
                                <span class=\"navbar-toggler-icon\"></span>
                            </button>

                            <div class=\"collapse navbar-collapse\" id=\"navbarSupportedContent\">
                                <ul class=\"navbar-nav mr-auto\">
                                    <li class=\"nav-item active\">
                                        <a class=\"nav-link\" href=\"{{ path('home_homepage')}}\">Home <span class=\"sr-only\">(current)</span></a>
                                    </li>
                                    <li class=\"nav-item\">
                                        <a class=\"nav-link\" href=\"{{ path('profile',{id: app.session.get('id')}) }}\">Perfil</a>
                                    </li>
                                    <li class=\"nav-item\">
                                        <a class=\"nav-link\" href=\"{{ path('home_profile')}}\">Mis Posts</a>
                                    </li>
                                    <li class=\"nav-item\">
                                        <a class=\"nav-link\" href=\"{{ path('entrada_homepage') }}\">Crear Blog</a>
                                    </li>
                                    {% if app.session.get('rol') == constant('LoginBundle\\\\Repository\\\\usersRepository::USER_ADMIN') %}
                                        <li class=\"nav-item\">
                                            <a class=\"nav-link\" href=\"{{ path('list_user') }}\">Listado de Usuarios</a>
                                        </li>
                                    {% endif %}
                                    <li class=\"nav-item\">
                                        <a href=\"{{ path('logout') }}\" class=\"nav-link\">Salir</a>
                                    </li>
                                </ul>
                            </div>
                        </nav>
                    </div>
                {% endblock %}
                {% block content %}{% endblock %}
            </div>
        </div>

